import './App.scss';

import Eu from './images/imagem-perfil.png'
import Star from './images/star.svg'
import Twitter from './images/twitter.svg'
import Mc from './images/mc.svg'
import Bk from './images/bk.svg'


function App() {
  return (
    <div>
      <header>
        <img src={Eu} id="me"/>
        <img src={Twitter}/>
        <img src={Star}/>
      </header>
      <hr></hr>
    </div>
  );
}

export default App;
